<h2>&lt;=</h2>less-than-or-equal test
<pre>Major Section:  <a href="PROGRAMMING.html">PROGRAMMING</a>
</pre><p>

<code>&lt;=</code> is a macro, and <code>(&lt;= x y)</code> expands to the same thing as
<code>(not (&lt; y x))</code>.  See <a href="_lt_.html">&lt;</a>.
<p>
<code>&lt;=</code> is a Common Lisp function.  See any Common Lisp documentation
for more information.
